ComponentFormat.FormatContent:
{{#each ComponentRecordJson.venue-chart-multi-color}}
<!-- Table 5 Starts - not used in any page -->
<div class="table5-widget 
        {{IfCond data.set-top-padding-to-zero[].0 '=' 'Yes'}} uk-padding-remove-top {{/IfCond}} 
        {{IfCond data.set-bottom-padding-to-zero[].0 '=' 'Yes'}} uk-padding-remove-bottom {{/IfCond}} {{IfCond data.set-alternate-table-row-color[].0 '=' 'Yes'}} alternate-table-row-color {{/IfCond}} 
    ">
    <div class="uk-container">
        <div class="table5-widget__container dynamiccomponenteditenable" %%componentRecordEditable%%>
            <div class="table5-widget__col">
                <!-- bg transparent Condition apply -->
                <div class="table5-col__content">
                    <h5 class="title title--m table5-widget__maintitle" tabindex="0">{{data.title}}</h5>
                    {{IfCond data.description 'notempty' ''}}
                    <div class="text-editor uk-margin-remove-bottom table5-widget__desc" tabindex="0">
                        {{{data.description}}}
                    </div>
                    {{/IfCond}}
                </div>
                {{IfMultipleOrCond data.primary-button-link 'notempty' '' data.secondary-button-link 'notempty' ''}}
                <div class="table5-col__button">
                    <div class="button-combo">
                        {{IfCond data.primary-button-link 'notempty' '' 'and' data.primary-button-text 'notempty' ''}}
                            <a href="{{data.primary-button-link}}" class="uk-button uk-button-primary">{{data.primary-button-text}} <span class="sr-only">for {{data.title}}</span></a>
                        {{/IfCond}}

                        {{IfCond data.secondary-button-link 'notempty' '' 'and' data.secondary-button-text 'notempty' ''}}
                            <a href="{{data.secondary-button-link}}" class="uk-button uk-button-default">{{data.secondary-button-text}} <span class="sr-only">for {{data.title}}</span></a>
                        {{/IfCond}}
                    </div>
                </div>
                {{/IfMultipleOrCond}}
            </div>
            {{IfCond data.table 'notempty' ''}}
            <div class="uk-overflow-auto table5-col__data" tabindex="0">
                {{{data.table}}}
            </div>
            {{/IfCond}}
        </div>
    </div>
</div>
<!-- Table 5 Ends -->
{{/each}}
